SELECT segment_marche, formule_dmgp, ca_cr_commune, SUM(ca_recharges) AS total_ca_recharges, SUM(ca_cartes) AS total_ca_cartes, SUM(ca_wave) AS total_ca_wave, SUM(ca_credit_om) AS total_ca_credit_om, SUM(ca_pass_glob_om_jour) AS total_ca_pass_glob_om_jour, SUM(ca_seddo) AS total_ca_seddo, SUM(ca_iah) AS total_ca_iah, SUM(self_top_up) AS total_self_top_up, SUM(nb_j_distinct) AS total_nb_j_distinct FROM reporting_ca_monthly GROUP BY segment_marche, formule_dmgp, ca_cr_commune ORDER BY SUM(ca_recharges) DESC LIMIT 20; 

SELECT segment_marche, formule_dmgp, ca_cr_commune_90j, SUM(sous_mnt) AS total_sous_mnt, SUM(sous_cnt) AS total_sous_cnt, SUM(ca_data) AS total_ca_data, SUM(ca_voix) AS total_ca_voix, SUM(nb_subs) AS total_nb_subs FROM reporting_souscription_monthly GROUP BY segment_marche, formule_dmgp, ca_cr_commune_90j ORDER BY SUM(sous_mnt) DESC LIMIT 20;

SELECT segment_marche, formule_dmgp, ca_cr_commune, SUM(parc_data_facturer) AS total_parc_data_facturer, SUM(volumes) AS total_volumes, SUM(ca_data) AS total_ca_data, SUM(sous_mnt) AS total_sous_mnt FROM reporting_ca_data_monthly GROUP BY segment_marche, formule_dmgp, ca_cr_commune ORDER BY SUM(parc_data_facturer) DESC LIMIT 20;

SELECT segment_marche, formule_dmgp, ca_cr_commune, SUM(trafic_5g_go) AS total_trafic_5g_go, SUM(trafic_4g_go) AS total_trafic_4g_go, SUM(trafic_3g_go) AS total_trafic_3g_go, SUM(trafic_2g_go) AS total_trafic_2g_go, SUM(total_volume_go) AS total_total_volume_go FROM reporting_trafic_data_monthly GROUP BY segment_marche, formule_dmgp, ca_cr_commune ORDER BY SUM(trafic_5g_go) DESC LIMIT 20;

SELECT segment_marche, formule_dmgp, ca_cr_commune, SUM(csu_mobile) AS total_csu_mobile, SUM(div) AS total_div, SUM(expresso_mobile) AS total_expresso_mobile, SUM(fixe_expresso) AS total_fixe_expresso, SUM(fixe_sonatel) AS total_fixe_sonatel, SUM(orange) AS total_orange, SUM(free) AS total_free, SUM(promobile) AS total_promobile, SUM(international) AS total_international FROM reporting_monthly_voix GROUP BY segment_marche, formule_dmgp, ca_cr_commune ORDER BY SUM(csu_mobile) DESC LIMIT 20;

SELECT segment_marche, formule_dmgp, ca_cr_commune_90j, SUM(ca_payg) AS total_ca_payg, SUM(ca_pass) AS total_ca_pass, SUM(duration_mn_payg) AS total_duration_mn_payg, SUM(duration_mn_pass) AS total_duration_mn_pass FROM reporting_monthly_international GROUP BY segment_marche, formule_dmgp, ca_cr_commune_90j ORDER BY SUM(ca_payg) DESC LIMIT 20;

SELECT segment_marche, formule_dmgp, ca_cr_commune_90j, SUM(parc) AS total_parc, SUM(parc_actif_orange) AS total_parc_actif_orange, SUM(total_sous_mnt) AS total_total_sous_mnt, SUM(parc_actif_sva) AS total_parc_actif_sva, SUM(ca_recharge) AS total_ca_recharge FROM reporting_monthly_sva GROUP BY segment_marche, formule_dmgp, ca_cr_commune_90j ORDER BY SUM(parc) DESC LIMIT 20;

SELECT segment_marche, formule_dmgp, ca_cr_commune, SUM(mnt_transaction) AS total_mnt_transaction, SUM(nb_events) AS total_nb_events, SUM(nb_subs) AS total_nb_subs FROM reporting_monthly_maxit GROUP BY segment_marche, formule_dmgp, ca_cr_commune ORDER BY SUM(mnt_transaction) DESC LIMIT 20;

SELECT segment_marche, formule_dmgp, ca_cr_commune_90j, SUM(BUY_DATA_parc) AS total_BUY_DATA_parc, SUM(BUY_DATA_CA_HTTC) AS total_BUY_DATA_CA_HTTC, SUM(BUY_DATA_CA) AS total_BUY_DATA_CA, SUM(BUY_ILLIFLEX_parc) AS total_BUY_ILLIFLEX_parc, SUM(BUY_ILLIFLEX_CA_HTTC) AS total_BUY_ILLIFLEX_CA_HTTC, SUM(BUY_ILLIFLEX_CA) AS total_BUY_ILLIFLEX_CA FROM reporting_usage_maxit GROUP BY segment_marche, formule_dmgp, ca_cr_commune_90j ORDER BY SUM(BUY_DATA_parc) DESC LIMIT 20;

SELECT segment_marche, formule_dmgp, region_90j, departement_90j, ca_cr_commune_90j, SUM(SARGAL_BALANCE_BRACKETS) AS total_SARGAL_BALANCE_BRACKETS, SUM(nb_subs) AS total_nb_subs, SUM(balance_sargal) AS total_balance_sargal FROM reporting_sargal_inscrits GROUP BY segment_marche, formule_dmgp, region_90j, departement_90j, ca_cr_commune_90j ORDER BY SUM(SARGAL_BALANCE_BRACKETS) DESC LIMIT 20;

SELECT formule_dmgp, SUM(parc) AS total_parc, SUM(reactives) AS total_reactives, SUM(sortants_acquisition) AS total_sortants_acquisition, SUM(sortants_gratuite) AS total_sortants_gratuite, SUM(sortants_usage) AS total_sortants_usage, SUM(gross_adds) AS total_gross_adds FROM reporting_parc_monthly GROUP BY formule_dmgp ORDER BY SUM(parc) DESC LIMIT 20;
